INSERT INTO `tbl_proyectos` (`id`, `str_empresa`, `str_proyecto`, `int_horas`, `dmt_fecha`, `str_descripcion`, `blb_img`, `bol_eliminado`) VALUES
(1, 'ISC Bunkerramos', 'Implementación del Fortinet', 80, '02/2016', 'Proteger la red interna de una organización, separando los servicios privados de la red pública de los servicios personales asi como asegurar la transferencia de datos, reducir el ancho de banda para evitar cuellos de botella en horarios críticos.&lt;ul&gt;&lt;li&gt;Habilitar el acceso a usuarios remotos; conectarse y acceder a la red&lt;/li&gt;&lt;li&gt;Disminuir el consumo de ancho de banda en horas críticas&lt;/li&gt;&lt;li&gt;Filtrar por seguridad el contenido de páginas web.&lt;/li&gt;&lt;li&gt;Proporcionar conectividad segura entre dos o multiples redes privadas l LAN&lt;/li&gt;&lt;li&gt;Protección durante la transmisión de los datos&lt;/li&gt;&lt;/ul&gt;', , 0);
INSERT INTO `tbl_proyectos` (`id`, `str_empresa`, `str_proyecto`, `int_horas`, `dmt_fecha`, `str_descripcion`, `blb_img`, `bol_eliminado`) VALUES
(2, 'ISC Bunkerramos', 'Implementación de Central Telefónica ', 80, '12/2016', 'Actualización de la central telefónica que tenía la empresa, luego de 10 años la cual se encontraba en periodo de obsolescencia.  Se ejecutó la Instalación del Sistema Unificado cisco modelo communications manager business edistion 6000 CM de Comunicación Cisco en ISC Bunker:&lt;ul&gt;&lt;li&gt;Cambio de call manager&lt;/li&gt;&lt;li&gt;Actualización de las licencias según perfil y cargo&lt;/li&gt;&lt;li&gt;Se distribuyó las licencias bajo el esquema planteado&lt;/li&gt;&lt;/ul&gt;&lt;br&gt;Beneficios:&lt;ul&gt;&lt;li&gt;Central telefónica amparado bajo un contrato de licenciamiento&lt;/li&gt;&lt;li&gt;Se minimizan los riesgos de problemas con el equipo e inestabilidad&lt;/li&gt;&lt;li&gt;Implementación de Cisco Jabber a los directores de la empresa puede dotar a sus empleados de funciones de presencia, mensajería, voz, vídeo, mensajería de voz, uso compartido de escritorios y conferencias a distancia.&lt;/li&gt;&lt;/ul&gt;', , 0);
INSERT INTO `tbl_proyectos` (`id`, `str_empresa`, `str_proyecto`, `int_horas`, `dmt_fecha`, `str_descripcion`, `blb_img`, `bol_eliminado`) VALUES
(3, 'Ofilarco', 'Creacion, configuracion e instalacion de un Sistema de Backup (Nass /Google Drive)', 160, '12/2016', 'Se realizó la implementación de una herramienta de backup, con su esquema de sheduler de los servidores y la subida a google drive como segundo respaldo, el mismo fue ejecutado, configurado y puesta en producción con total éxito.', , 0);
INSERT INTO `tbl_proyectos` (`id`, `str_empresa`, `str_proyecto`, `int_horas`, `dmt_fecha`, `str_descripcion`, `blb_img`, `bol_eliminado`) VALUES
(4, 'Expotran', 'Auditoria Virtual', 160, '04/2016', 'MONITOR TECNOLOGICO Se basa en la aplicación de las últimas tecnologías en monitoreo y control mediante la instalación y uso de agentes virtuales en las estaciones de trabajo, lo cual nos permitió: &lt;ul&gt; &lt;li&gt;Realizar el análisis y levantamiento de la plataforma tecnológica actual de la organización&lt;/li&gt; &lt;li&gt;Inventario y diagnóstico de las estaciones de trabajos instaladas en su organización.&lt;/li&gt; &lt;li&gt;Elaboración de mantenimiento preventivo, correctivo y limpieza de caches fuera de horario de trabajo minimizando el tiempo offline.&lt;/li&gt; &lt;li&gt;Resultados adaptados a las normas ISO o auditorías internas de equipos.&lt;/li&gt; &lt;/ul&gt;', , 0);
INSERT INTO `tbl_proyectos` (`id`, `str_empresa`, `str_proyecto`, `int_horas`, `dmt_fecha`, `str_descripcion`, `blb_img`, `bol_eliminado`) VALUES
(5, 'Grupo Prisma', 'Migracion de Exchange a Office365', 160, '10/2015', 'Se realizó la migracion de la herramienta de correo Microsoft Exchange 2003 a la nueva plataforma de correo Office 365., el proyecto fueron migrados 200 cuentas de usuarios con la programación de la replicación a la nube e los buzones, y corte del servicio con el servidor anterior. Configuración de Outlook en todos los equipos de los usuarios con su respectivo adiestramiento, actualización del office a los equipos  con la última versión. Finalmente pruebas de certificación  y cierre del proyecto totalmente satisfactorio.', , 0);
INSERT INTO `tbl_proyectos` (`id`, `str_empresa`, `str_proyecto`, `int_horas`, `dmt_fecha`, `str_descripcion`, `blb_img`, `bol_eliminado`) VALUES
(6, 'Ofilarco', 'Creacion de DMZ para Servidores', 160, '11/2016', 'La empresa ofilarco requiere la configuración de una zona desmilitarizada para la instalación de una aplicación que debe estar separada de su red LAN, el personal de Axion realiza el análisis y le propone la solución de crear esta DMZ el cual permita hacer lo solicitado por el cliente, separar el servidor de la red lan, que pudieran acceder desde internet al aplicativo que el aplicativo tuviera acceso a la base de datos solicitada. El mismo se logró con total éxito y en el tiempo estipulado. ', , 0);
INSERT INTO `tbl_proyectos` (`id`, `str_empresa`, `str_proyecto`, `int_horas`, `dmt_fecha`, `str_descripcion`, `blb_img`, `bol_eliminado`) VALUES
(7, 'BG Technology', 'Migracion de Servidores Físicos a la Azure', 160, '11/2016', 'Cliente solicita tener un centro de datos alternos con sus aplicaciones críticas, AXION TI realiza el análisis de la situación actual y ejecuta el plan de disaster recovery donde procede a la instalación de un centro de datos alternos con la configuración de las aplicaciones críticas del negocio, basado su plataforma en Microsoft azure como solución. Cumpliendo con las necesidades y objetivo plasmado por el cliente y realizando el cierre del proyecto en el tiempo señalado en la propuesta.', , 0);

